import VueRouter from 'vue-router'

//引入组件
import Index from '../pages'
import Home from '../pages/home/home'
import Login from '../pages/login/login'
import Register from '../pages/register/register'
import Center from '../pages/center/center'
import Forum from '../pages/forum/list'
import ForumAdd from '../pages/forum/add'
import ForumDetail from '../pages/forum/detail'
import MyForumList from '../pages/forum/myForumList'
import Storeup from '../pages/storeup/list'
import yonghuList from '../pages/yonghu/list'
import yonghuDetail from '../pages/yonghu/detail'
import yonghuAdd from '../pages/yonghu/add'
import gonggaoxinxiList from '../pages/gonggaoxinxi/list'
import gonggaoxinxiDetail from '../pages/gonggaoxinxi/detail'
import gonggaoxinxiAdd from '../pages/gonggaoxinxi/add'
import zhanguanxinxiList from '../pages/zhanguanxinxi/list'
import zhanguanxinxiDetail from '../pages/zhanguanxinxi/detail'
import zhanguanxinxiAdd from '../pages/zhanguanxinxi/add'
import zangpinxinxiList from '../pages/zangpinxinxi/list'
import zangpinxinxiDetail from '../pages/zangpinxinxi/detail'
import zangpinxinxiAdd from '../pages/zangpinxinxi/add'
import yuyuejiluList from '../pages/yuyuejilu/list'
import yuyuejiluDetail from '../pages/yuyuejilu/detail'
import yuyuejiluAdd from '../pages/yuyuejilu/add'
import aboutusList from '../pages/aboutus/list'
import aboutusDetail from '../pages/aboutus/detail'
import aboutusAdd from '../pages/aboutus/add'

const originalPush = VueRouter.prototype.push
VueRouter.prototype.push = function push(location) {
	return originalPush.call(this, location).catch(err => err)
}

//配置路由
export default new VueRouter({
	routes:[
		{
      path: '/',
      redirect: '/index/home'
    },
		{
			path: '/index',
			component: Index,
			children:[
				{
					path: 'home',
					component: Home
				},
				{
					path: 'center',
					component: Center,
				},
				{
					path: 'forum',
					component: Forum
				},
				{
					path: 'forumAdd',
					component: ForumAdd
				},
				{
					path: 'forumDetail',
					component: ForumDetail
				},
				{
					path: 'myForumList',
					component: MyForumList
				},
				{
					path: 'storeup',
					component: Storeup
				},
				{
					path: 'yonghu',
					component: yonghuList
				},
				{
					path: 'yonghuDetail',
					component: yonghuDetail
				},
				{
					path: 'yonghuAdd',
					component: yonghuAdd
				},
				{
					path: 'gonggaoxinxi',
					component: gonggaoxinxiList
				},
				{
					path: 'gonggaoxinxiDetail',
					component: gonggaoxinxiDetail
				},
				{
					path: 'gonggaoxinxiAdd',
					component: gonggaoxinxiAdd
				},
				{
					path: 'zhanguanxinxi',
					component: zhanguanxinxiList
				},
				{
					path: 'zhanguanxinxiDetail',
					component: zhanguanxinxiDetail
				},
				{
					path: 'zhanguanxinxiAdd',
					component: zhanguanxinxiAdd
				},
				{
					path: 'zangpinxinxi',
					component: zangpinxinxiList
				},
				{
					path: 'zangpinxinxiDetail',
					component: zangpinxinxiDetail
				},
				{
					path: 'zangpinxinxiAdd',
					component: zangpinxinxiAdd
				},
				{
					path: 'yuyuejilu',
					component: yuyuejiluList
				},
				{
					path: 'yuyuejiluDetail',
					component: yuyuejiluDetail
				},
				{
					path: 'yuyuejiluAdd',
					component: yuyuejiluAdd
				},
				{
					path: 'aboutus',
					component: aboutusList
				},
				{
					path: 'aboutusDetail',
					component: aboutusDetail
				},
				{
					path: 'aboutusAdd',
					component: aboutusAdd
				},
			]
		},
		{
			path: '/login',
			component: Login
		},
		{
			path: '/register',
			component: Register
		},
	]
})
